import React from 'react';
import './App.css';
import Menu from './Menu';
import List from './List';


class App extends React.Component{
  constructor(props){
    super(props);

    this.state = {
      movies:[
        {id:0, rating: 4, title: 'The Ballad of Buster Scrugs', image: 'libro01.jpg'},
        {id:1, rating: 3, title: 'The Sister Brothers', image: 'libro02.jpg'},
        {id:2, rating: 5, title: 'The Homesman', image: 'libro03.jpg'},
        {id:3, rating: 5, title: 'Django', image: 'libro04.jpg'},
        {id:4, rating: 5, title: 'Hostiles', image: 'libro05.jpg'}
      ]
    };
  }
  render(){  
    return (
    <div className="App">
      <Menu title="Vladi.codes" />
      <List items={this.state.movies} />
    </div>
  );
  }
}

export default App;
